import React, { Component } from "react";
import './styles/home.less';

class Home extends Component {
  render() {
    return (
      <div className="home">
        <div className="home-wrapper">
          <div className="home-title">
          <div className="home-text">hello</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
